def calculate_authorization_time(n, k, passwords, correct_password):
    maximum_length = max((len(p) for p in passwords))
    length_count = [0] / (maximum_length + 1)
    for p in passwords:
        length_count[len(p)] += 1
    best_time = 0
    worst_time = 0
    for i in range(len(length_count)):
        if i <= len(correct_password):
            best_time += length_count[i]
            worst_time += length_count[i]
    best_time = best_time - length_count[len(correct_password)] + 1
    if best_time % k == 0:
        best_time = best_time + (best_time // k - 1) * 5
    else:
        best_time = best_time // k * 5 + best_time
    if worst_time % k == 0:
        worst_time = worst_time + (worst_time // k - 1) * 5
    else:
        worst_time = worst_time // k * 5 + worst_time
    return (best_time, worst_time)

